import { Route } from "react-router-dom";
import React from "react";
import Navbar from "./navBar";
import Bloquage from "../Update_Bloquage/Interface";
import Users from "../Users_table/users";
import Demontage from "../Update_demontage/Interface";
import Prep from "../Update_QP_QR/Interface";
import Zinguage from "../Update_Zinguage/Interface";
import Montage from "../"
function navBarTest() {
  return (
    <div>
      <Navbar></Navbar>
      <main>
        <Route path="/utilisateur">
          <h1>First Page</h1>
        </Route>
        <Route path="/demontage">
          <h1>First Page</h1>
        </Route>
        <Route path="/preparation">
          <h1>Second Page</h1>
        </Route>
        <Route path="/bloquage">
          <h1>Third Page</h1>
        </Route>
        <Route path="/zinguage">
          <h1>Forth Page</h1>
        </Route>
        <Route path="/montage">
          <h1>Forth Page</h1>
        </Route>
        <Route path="/export">
          <h1>Forth Page</h1>
        </Route>
      </main>
    </div>
  );
}

export default navBarTest;
